.macro barrett_32 a, Qbar, Q, tmp
    smmulr.w \tmp, \a, \Qbar
    mls.w \a, \tmp, \Q, \a
.endm

.macro FNT_CT_butterfly c0, c1, logW
    add.w \c0, \c0, \c1, lsl #\logW
    sub.w \c1, \c0, \c1, lsl #(\logW+1)
.endm

