    mla \tmp2, \c1, \twiddle, \tmp
    mls \c3, \c1, \twiddle, \tmp

    // 1,3
    mla \tmp, \c2, \twiddle, \c0
    mls \c0, \c2, \twiddle, \c0

    vmov.w \twiddle, \xi2

    // 4,6
    mla \c2, \c6, \twiddle, \c4
    mls \c1, \c6, \twiddle, \c4

    // 5,7
    mla \c6, \c7, \twiddle, \c5
    mls \c7, \c7, \twiddle, \c5

